import React from "react";
import PropTypes from 'prop-types';
import Link from 'next/link'
import {Menu, Input, Row, Col} from 'antd';


const AppLayout = ({children}) => {
    return(
        <div>
            <Menu mode="horizontal">

        <div>
        <Menu.Item><Link href="/"><a>nodebird</a></Link></Menu.Item>
        <Menu.Item><Link href="/profile"><a>profile</a></Link></Menu.Item>
        <Menu.Item><Link href="/signup"><a>signup</a></Link></Menu.Item>
        <Menu.Item><Input.Search enterButton style={{vertical : 'middle'}} ></Input.Search></Menu.Item>
        </div>
        </Menu>
        <Row>
            <Col xs ={24} md = {6} />
            <Col xs ={24} md = {12} />
            <Col xs ={24} md = {6} />
        </Row>
        {children}
        </div>

    )

};

AppLayout.propTypes = {
    children: PropTypes.node.isRequired,
};
export default AppLayout
